// src/components/About.js
import React from 'react';
import './About.css';

function About() {
  console.log("About component is rendering");

  return (
    <section id="about">
      <div>
        <h2>About</h2>
        <p>
          My name is Calvin Nguyen, a multifaceted professional with extensive experience and a strong interest in technology and cybersecurity...
        </p>
      </div>
    </section>
  );
}

export default About;
